import ExpenseTask from "./ExpenseTask";
import Expenseitem from "../Expenses/Expenseitem";

const ExpenseList = (props) => {
  let expensesContent  =  <p style={{color: "red"}}>No Expenses found</p>;
  if(props.item.length > 0){
    expensesContent = props.item.length > 0 &&  props.item.map((expense) => (
      <Expenseitem
      key = {expense.id}
      title={expense.title}
      rate={expense.rate}
      thatDay={expense.thatDay}
      />
      
      ));
  }
}
 
export default ExpenseList;
